import React from 'react'
import {selectIsOrderedSuccess, selectOrderedDetail} from "../../../redux/ordered/ordered.selectors";
import {connect} from "react-redux";
import {createStructuredSelector} from "reselect"
import {OrderedCompleteWrapper, Button} from "./ordered-complete.styles";
const OrderedComplete = ({orderedDetail}) => {
  if(!orderedDetail){
    return <OrderedCompleteWrapper>
      <h4>Rất tiếc, chúng tôi không tìm thấy hóa đơn thanh toán nào của bạn.</h4>
      <Button>Quay lại trang chủ</Button>
    </OrderedCompleteWrapper>
  }
  return (
    <div>

    </div>
  )
}

const mapStateToProps = createStructuredSelector({ 
  orderedDetail : selectOrderedDetail
})

export default connect(mapStateToProps)(OrderedComplete)
